import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

import App from './App';
import Register from './Register';

class AppRouter extends Component {
    
    render(){
        var routes = {
            'signin': 'http://localhost/api/signin',
            'signup': 'http://localhost/api/signup',
            'isUser': 'http://localhost/api/isUser',
            'update': 'http://localhost/api/updateaccount',
            'home': 'https://52.151.90.27/app',
            'moviehome': 'http://localhost/api/home',
            'movie': 'http://localhost/api/movie/?',
        }
        return(
            <Router>
                <Switch>
                    <Route exact path='/app' render={() => (
                        <App routes={routes}/>
                    )} />
                    <Route exact path='/' render={() => (
                        <Register routes={routes}/>
                    )} />
                </Switch>
            </Router>
        )
    }
}

export default AppRouter;
